jsxs("style", {
    "children": [
        ".jsx-styled-a23d57d{",
        "fill: url(#gradient)",
        "}"
    ]
});
jsx("meta", {
    "charSet": "utf-8"
});
jsx("title", {
    "children": "SVG Demo"
});
jsx("meta", {
    "name": "viewport",
    "content": "width=device-width"
});
jsxs(Fragment, {
    "children": [
        "\n\n  \n    ",
        "\n    ",
        "\n    ",
        "\n  \n  \n    ",
        jsxs("svg", {
            "viewBox": "0 0 100 100",
            "preserveAspectRatio": "xMidYMid slice",
            "role": "img",
            "children": [
                "\n      ",
                jsx("title", {
                    "children": "A gradient"
                }),
                "\n      ",
                jsxs("linearGradient", {
                    "id": "gradient",
                    "children": [
                        "\n        ",
                        jsx("stop", {
                            "offset": "0%",
                            "stopColor": "red",
                            "className": "begin"
                        }),
                        "\n        ",
                        jsx("stop", {
                            "offset": "100%",
                            "stopColor": "black",
                            "className": "end"
                        }),
                        "\n      "
                    ]
                }),
                "\n      ",
                jsx("rect", {
                    "x": "0",
                    "y": "0",
                    "width": "100",
                    "height": "100",
                    "className": "jsx-styled-a23d57d"
                }),
                "\n      ",
                jsx("circle", {
                    "cx": "50",
                    "cy": "50",
                    "r": "30",
                    "className": "jsx-styled-a23d57d"
                }),
                "\n    "
            ]
        }),
        "\n  \n\n"
    ]
});
